    "2015-08-21T22:27:09.140942",nt"name": "2009-vha-facility-quality-and-safety-report-population-quality-of-care",nt"isopen":
    true,nt"url": null,nt"notes": "The 2008 Hospital Report Card was mandated
    by the FY08 Appropriations Act, and focused on Congressionally-mandated metrics
    applicable to general patient populations. The 2009 VHA Facility Quality and Safety
    Report report, not required by Congress, shifts to Veteran-centered metrics, and
    includes information related to infrastructure, care provided in outpatient and
    hospital settings, quality of care within given patient populations, accreditation
    status, patient satisfaction and patient outcomes for FY2008.  The data in this
    report have been compiled from multiple sources throughout VHA.  This dataset includes
    composite scores reflecting quality of care for outpatients (NEXUS) and inpatients
    (ORYX). Quality of outpatient care is further stratified by comparison of outpatient
    care by gender, age, and mental health diagnosis.",nt"license_title": "Creative
